Seems Yahoo isn&#39;t letting anyone play the files that we post, so i&#39;ve  
attached them to this e-mail.

Files:

&quot;Bless You&quot;---That&#39;s what i heard and was pretty funny and polite for them  
to say that.

&quot;It&#39;s For Steve&quot;---No question was asked before this message

&quot;Lisa&quot;---&quot;Yeah&quot;---&quot;Maybe it&#39;s supposed to be hard&quot;---This ones a little  
rough, but i hear it

&quot;Punk&quot;---&quot;Blake&quot;-&quot;Blake&quot;---&quot;His Face&quot;------Blake is a guy i work with who  is 
helping me develop some new stuff, it&#39;s funny that they mentioned him.   
Blake is not a common name to be mentioned on the radio either.

&quot;Purple&quot;---&quot;Marcus&quot;---&quot;Chris&quot;---&quot;Chris&quot;---&quot;Beavis Hicks&quot;----I screwed up  
most of the names in real time, but i&#39;m only human.  The upside is that the  
files are getting longer, meaning better conversations.  Maybe frank knows  a 
beavis hicks.

&quot;You car&#39;s still running&quot;---I did this 5 minute session while getting ready  
for work this morning and my car was outside running to warm up.  I guess  
they picked up on that.  This file is a little rough as well.

_____________


I also included the two from Frank&#39;s video that were very clear  messages.

&quot;Where&#39;s Purple&quot; and &quot;We&#39;re friggin&#39; People&quot;


Hope you can make out some of these,

-Steve H.


p.s. Hang tight for the second set of files.  I have one nerve left  and 
Yahoo is jumping on it like a trampoline.  I can only send a couple at  a time.





